function cs_save_widget($elm){var widget={};var locations={};var options={};$elm.find('.draggable-widget').each(function(){var name=$(this).data('name');var id=typeof $(this).data('id')=='undefined'?0:$(this).data('id');var order=$(this).index();var locations={};var options={};widget[order]={'name':name,'id':id,'locations':'','options':''};$(this).find('.select-template input').each(function(){locations[$(this).attr('name')]=$(this).is(':checked')?true:false;});$(this).find('.widget-option input, .widget-option select, .widget-option textarea').each(function(){options[$(this).attr('name')]=encodeURIComponent($(this).val());});widget[order]['locations']=locations;widget[order]['options']=options;});$.ajax({type:'post',url:ajax_url,data:{position:$elm.data('name'),widget_names:JSON.stringify(widget),action:'save_widget_position',},dataType:'json',context:$elm,success:function(response){$.each(response,function(index,item){$elm.find('.draggable-widget').eq(index).data('id',item);});$elm.closest('.widget-canvas').find('.widget-save').removeClass('active');},});}
